import React from "react";

function About() {
  return (
    <div className="container container--narrow py-md-5">
      <p>Renowned Blues and World music artist Ramon Goose has performed at all the major European Blues Festivals. His album releases include Long Road To Tiznit a fusion and Blues and North African styles which has been widely acclaimed.</p>

      <p>He now joins forces with David Parsons who started as a Blues and Jazz player before studying at the Royal College of Music specialising in the Lute and Early Music. He has performed widely in Europe, Scandinavia and the U.S. with many album releases including the the Lute Music of J.S. Bach.</p>

      <p>Together,Ramon and David draw on their different backgrounds bringing a fresh and vibrant approach to the Jazz Guitar.</p>
    </div>
  )
}

export default About;
